import React from "react";
import { Row } from "react-bootstrap";
import { Product } from "./Product";

const CartItem = ({ product }) => {
  return (
    <Row className="cartItem">
      <col>
        <Product />
      </col>
    </Row>
  );
};

export default CartItem;
